import React from 'react';
import { motion } from 'framer-motion';
import { FileText, BookOpen, User, ArrowRight } from 'lucide-react';
import { Link } from 'react-router-dom';
import DashboardLayout from '../components/layout/DashboardLayout';

const Dashboard = () => {
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        duration: 0.5
      }
    }
  };

  return (
    <DashboardLayout>
      <div className="min-h-screen bg-gradient-to-br from-gray-50 to-gray-100">
        <div className="max-w-7xl mx-auto py-8 sm:px-6 lg:px-8">
          <motion.div 
            initial={{ opacity: 0, y: -20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
            className="px-4 py-6 sm:px-0"
          >
            <div className="mb-8">
              <h1 className="text-4xl font-bold text-gray-900 mb-2">Welcome Back!</h1>
              <p className="text-lg text-gray-600">Manage your legal documents and resources</p>
            </div>

            <motion.div 
              variants={containerVariants}
              initial="hidden"
              animate="visible"
              className="grid grid-cols-1 gap-8 sm:grid-cols-2 lg:grid-cols-3"
            >
              {/* Documents Card */}
              <motion.div
                variants={itemVariants}
                whileHover={{ scale: 1.02, y: -5 }}
                className="bg-white overflow-hidden shadow-lg rounded-xl hover:shadow-xl transition-shadow duration-300"
              >
                <Link to="/documents" className="block p-8">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center">
                      <div className="flex-shrink-0 bg-blue-500 rounded-xl p-4">
                        <FileText className="h-8 w-8 text-white" />
                      </div>
                      <div className="ml-5">
                        <h3 className="text-xl font-semibold text-gray-900">Documents</h3>
                        <p className="text-sm text-gray-500 mt-1">View and manage your legal documents</p>
                      </div>
                    </div>
                    <ArrowRight className="h-5 w-5 text-gray-400" />
                  </div>
                </Link>
              </motion.div>

              {/* Glossary Card */}
              <motion.div
                variants={itemVariants}
                whileHover={{ scale: 1.02, y: -5 }}
                className="bg-white overflow-hidden shadow-lg rounded-xl hover:shadow-xl transition-shadow duration-300"
              >
                <Link to="/glossary" className="block p-8">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center">
                      <div className="flex-shrink-0 bg-green-500 rounded-xl p-4">
                        <BookOpen className="h-8 w-8 text-white" />
                      </div>
                      <div className="ml-5">
                        <h3 className="text-xl font-semibold text-gray-900">Glossary</h3>
                        <p className="text-sm text-gray-500 mt-1">Legal terms and definitions</p>
                      </div>
                    </div>
                    <ArrowRight className="h-5 w-5 text-gray-400" />
                  </div>
                </Link>
              </motion.div>

              {/* Profile Card */}
              <motion.div
                variants={itemVariants}
                whileHover={{ scale: 1.02, y: -5 }}
                className="bg-white overflow-hidden shadow-lg rounded-xl hover:shadow-xl transition-shadow duration-300"
              >
                <Link to="/profile" className="block p-8">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center">
                      <div className="flex-shrink-0 bg-purple-500 rounded-xl p-4">
                        <User className="h-8 w-8 text-white" />
                      </div>
                      <div className="ml-5">
                        <h3 className="text-xl font-semibold text-gray-900">Profile</h3>
                        <p className="text-sm text-gray-500 mt-1">Manage your account settings</p>
                      </div>
                    </div>
                    <ArrowRight className="h-5 w-5 text-gray-400" />
                  </div>
                </Link>
              </motion.div>
            </motion.div>
          </motion.div>
        </div>
      </div>
    </DashboardLayout>
  );
};

export default Dashboard;
